extern "C" void
ob_fp (char *smiles, unsigned int *fp)
{
    OBMol *mol;
    OBFingerprint *fprint2, *fprint3;
    vector < unsigned int >vfp;
    fprint2 = OBFingerprint::FindFingerprint ("FP2");
    fprint3 = OBFingerprint::FindFingerprint ("FPPC8");
    vector < unsigned int >::iterator i;
    string tmpStr (smiles);
    int len;

    //ob_rehydrate_molecule(&mol, serializedInput);

    mol = convertToOBMol(tmpStr,"SMI");

    mol->ConvertDativeBonds();

    fprint2->GetFingerprint (mol, vfp);

    memset(fp,0x0, OB_FPSIZE*sizeof(unsigned int));

    memcpy (fp, &vfp[0], OB_FPSIZE2*sizeof(unsigned int));

    if (fprint3 != NULL)
    {

        vfp.clear();

        fprint3->GetFingerprint (mol, vfp);

        len = vfp.size();

        if (len > OB_FPSIZE3)
        {
            len = OB_FPSIZE3;
            cout << "Warning: Index dictionary size exceeded. Only the first " << OB_FPSIZE3*sizeof(unsigned int)*8 << " bits will be used!" << endl;
        }

        memcpy (fp+OB_OFFSET, &vfp[0], len*sizeof(unsigned int));
    }
    else
    {
        cout << "FPPC8 fingerprint not found!" << endl;
    }
    delete mol;
}

extern "C" double
ob_tanimoto (const unsigned int *fp1, const unsigned int *fp2, unsigned short size)
{
    // Fast tanimoto code with 16 bit LUT by Andrew Dalke as published in http://www.dalkescientific.com/writings/diary/archive/2008/06/27/computing_tanimoto_scores.html.
    //   Used with permission

    unsigned int and_count=0, or_count=0,t;

    while (size--)
    {
        t = (*fp2 | *fp1);
        or_count += popcount_counts_16[t&65535];
        or_count += popcount_counts_16[t>>16];

        t = (*fp2 & *fp1);
        and_count += popcount_counts_16[t&65535];
        and_count += popcount_counts_16[t>>16];

        fp2++;
        fp1++;
    }

    return static_cast<double>(and_count)/or_count;
}


extern "C" double
ob_tversky (const unsigned int *fp1_prototype, const unsigned int *fp2_variant, unsigned short size, double alpha_prototype, double beta_variant)
{
    unsigned int a=0,b=0,c=0,t;

    if(alpha_prototype<0.0f) alpha_prototype=0.0f;
    if(alpha_prototype>1.0f) alpha_prototype=1.0f;
    if(beta_variant<0.0f) beta_variant=0.0f;
    if(beta_variant>1.0f) beta_variant=1.0f;

    while (size--)
    {
        t = (*fp2_variant & *fp1_prototype);
        a += popcount_counts_16[(*fp1_prototype)&65535];
        a += popcount_counts_16[(*fp1_prototype)>>16];
        b += popcount_counts_16[(*fp2_variant)&65535];
        b += popcount_counts_16[(*fp2_variant)>>16];
        c += popcount_counts_16[t&65535];
        c += popcount_counts_16[t>>16];

        fp1_prototype++;
        fp2_variant++;
    }

    return static_cast<double>(c)/((a - c)*alpha_prototype+(b - c)*beta_variant+c);
}


