extern "C" char *
ob_spectrophore (char *smiles)
{
    OBMol *mol;
    OBConversion conv;
    OBSpectrophore spec;
    string tmpStr (smiles);
    stringstream outstringstream;
    vector<double> sphorevec;
    int len=0;

    mol = convertToOBMol(tmpStr,"SMI");

    /*spec.SetResolution(3.0);
    spec.SetAccuracy(spec.AccuracyOption::AngStepSize20);
    spec.SetStereo(NoStereoSpecificProbes);
    spec.SetNormalization(NormalizationTowardsZeroMean);*/

    sphorevec = spec.GetSpectrophore(mol);

    delete mol;

    outstringstream << setprecision(16);

    len = sphorevec.size();

    for(int i(0); i<len; i++)
    {
        outstringstream << sphorevec[i];
        if(i<len-1) outstringstream << ";";
    }

    return strdup(outstringstream.str().c_str());
}


